import React from 'react' ;

class UserList extends React.Component {
    render () {
        return (
            <tr>
                <td>1</td>
                <td>Arun</td>
                <td>20</td>
                <td>arun@gmail.com</td>
                <td>Delhi</td>
            </tr>
        );
    }
}

export default UserList ;
